contracts/ETFStaking.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.7.6;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "./base/SafeMath.sol";
import "./base/Ownable.sol";

contract ETFStaking is Ownable, ReentrancyGuard {
    using SafeMath for uint256;

    IERC20 public stakeToken;
    IERC20 public rewardToken;

    struct StakeInfo {
        uint256 amount;
        uint256 startTime;
        uint256 duration;
        uint256 rewardMultiplier;
        bool autoReinvest;
    }

    mapping(address => StakeInfo) public stakes;
    uint256 public totalStaked;
    uint256 public maxStakingCap = 1000000 * 10 ** 18; // Example cap

    uint256 public baseRewardRate = 1; // 1% reward for simplicity
    uint256 public penaltyRate = 10; // 10% penalty for early unstaking
    uint256 public cooldownPeriod = 7 days; // Example cooldown period for unstaking

    event Staked(
        address indexed user,
        uint256 amount,
        uint256 duration,
        bool autoReinvest
    );
    event Unstaked(address indexed user, uint256 amount);
    event RewardsClaimed(address indexed user, uint256 amount);

    // Constructor (visibility not required in 0.7.6)
    constructor(IERC20 _stakeToken, IERC20 _rewardToken) {
        stakeToken = _stakeToken;
        rewardToken = _rewardToken;
    }

    // Allow users to stake with a specific duration and optional auto-reinvestment
    function stake(
        uint256 _amount,
        uint256 _duration,
        bool _autoReinvest
    ) external nonReentrant {
        require(
            totalStaked.add(_amount) <= maxStakingCap,
            "Max staking cap reached"
        );
        require(_amount > 0, "Cannot stake 0 tokens");

        StakeInfo storage stakeInfo = stakes[msg.sender];
        require(stakeInfo.amount == 0, "Already staking");

        stakeToken.transferFrom(msg.sender, address(this), _amount);

        uint256 rewardMultiplier = calculateMultiplier(_duration);

        stakeInfo.amount = _amount;
        stakeInfo.startTime = block.timestamp;
        stakeInfo.duration = _duration;
        stakeInfo.rewardMultiplier = rewardMultiplier;
        stakeInfo.autoReinvest = _autoReinvest;

        totalStaked = totalStaked.add(_amount);

        emit Staked(msg.sender, _amount, _duration, _autoReinvest);
    }

    // Function to calculate rewards
    function calculateRewards(address _user) public view returns (uint256) {
        StakeInfo storage stakeInfo = stakes[_user];
        uint256 stakingTime = block.timestamp.sub(stakeInfo.startTime);

        if (stakingTime < stakeInfo.duration) {
            return 0; // No rewards if staking period is not complete
        }

        uint256 baseReward = stakeInfo
            .amount
            .mul(baseRewardRate)
            .mul(stakingTime)
            .div(100);
        return baseReward.mul(stakeInfo.rewardMultiplier).div(100);
    }

    // Claim rewards without unstaking
    function claimRewards() external nonReentrant {
        StakeInfo storage stakeInfo = stakes[msg.sender];
        uint256 rewards = calculateRewards(msg.sender);
        require(rewards > 0, "No rewards available");

        if (stakeInfo.autoReinvest) {
            stakeInfo.amount = stakeInfo.amount.add(rewards);
            totalStaked = totalStaked.add(rewards);
        } else {
            rewardToken.transfer(msg.sender, rewards);
        }

        emit RewardsClaimed(msg.sender, rewards);
    }

    // Unstake after staking period, with optional penalty for early unstake
    function unstake() external nonReentrant {
        StakeInfo storage stakeInfo = stakes[msg.sender];
        require(stakeInfo.amount > 0, "No active stake");

        uint256 stakingTime = block.timestamp.sub(stakeInfo.startTime);
        uint256 amountToUnstake = stakeInfo.amount;

        if (stakingTime < stakeInfo.duration) {
            // Early unstaking penalty
            uint256 penalty = amountToUnstake.mul(penaltyRate).div(100);
            amountToUnstake = amountToUnstake.sub(penalty);
        }

        totalStaked = totalStaked.sub(stakeInfo.amount);
        stakeInfo.amount = 0;

        stakeToken.transfer(msg.sender, amountToUnstake);

        emit Unstaked(msg.sender, amountToUnstake);
    }

    // Emergency unstake with a higher penalty
    function emergencyUnstake() external nonReentrant {
        StakeInfo storage stakeInfo = stakes[msg.sender];
        require(stakeInfo.amount > 0, "No active stake");

        uint256 penalty = stakeInfo.amount.mul(penaltyRate.mul(2)).div(100); // Double penalty for emergency unstake
        uint256 amountToUnstake = stakeInfo.amount.sub(penalty);

        totalStaked = totalStaked.sub(stakeInfo.amount);
        stakeInfo.amount = 0;

        stakeToken.transfer(msg.sender, amountToUnstake);

        emit Unstaked(msg.sender, amountToUnstake);
    }

    // Function to set max staking cap (Governance controlled)
    function setMaxStakingCap(uint256 _cap) external onlyOwner {
        maxStakingCap = _cap;
    }

    // Function to set base reward rate (Governance controlled)
    function setBaseRewardRate(uint256 _rate) external onlyOwner {
        baseRewardRate = _rate;
    }

    // Function to set penalty rate (Governance controlled)
    function setPenaltyRate(uint256 _rate) external onlyOwner {
        penaltyRate = _rate;
    }

    // Function to calculate multiplier based on duration
    function calculateMultiplier(
        uint256 _duration
    ) public pure returns (uint256) {
        if (_duration >= 365 days) {
            return 150; // 1.5x for 1 year or more
        } else if (_duration >= 180 days) {
            return 125; // 1.25x for 6 months or more
        } else if (_duration >= 90 days) {
            return 110; // 1.1x for 3 months or more
        } else {
            return 100; // No multiplier for less than 3 months
        }
    }

    // Function to get staking details
    function getStakingDetails(
        address _user
    ) external view returns (uint256, uint256, uint256, bool) {
        StakeInfo storage stakeInfo = stakes[_user];
        return (
            stakeInfo.amount,
            stakeInfo.startTime,
            stakeInfo.duration,
            stakeInfo.autoReinvest
        );
    }
}

