// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity >=0.7.0 <0.9.0;
pragma abicoder v2;

import "@uniswap/v3-periphery/contracts/libraries/TransferHelper.sol";
import "@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol";

contract ETFSwapper {
    ISwapRouter public immutable swapRouter;

    event SwapForGivenInput(
        address indexed token1,
        address indexed token2,
        uint amountIn,
        uint amountOut
    );
    event SwapForGivenOutput(
        address indexed token1,
        address indexed token2,
        uint amountIn,
        uint amountOut
    );
    event MultiSwapForGivenInput(
        address indexed token0,
        address indexed token1,
        uint amountIn,
        uint amountOut
    );
    event MultiSwapForGivenOutput(
        address indexed token0,
        address indexed token1,
        uint amountIn,
        uint amountOut
    );

    constructor(address etfSwapRouter) {
        swapRouter = ISwapRouter(etfSwapRouter);
    }

    function swapForGivenInput(
        address token1,
        address token2,
        uint amountIn,
        uint24 fee,
        uint deadline
    ) external returns (uint amountOut) {
        require(deadline > block.timestamp, "ETFSwapper: Deadline passed");

        TransferHelper.safeTransferFrom(
            token1,
            msg.sender,
            address(this),
            amountIn
        );
        TransferHelper.safeApprove(token1, address(swapRouter), amountIn);

        ISwapRouter.ExactInputSingleParams memory params = ISwapRouter
            .ExactInputSingleParams({
                tokenIn: token1,
                tokenOut: token2,
                fee: fee,
                recipient: msg.sender,
                deadline: deadline,
                amountIn: amountIn,
                amountOutMinimum: 0,
                sqrtPriceLimitX96: 0
            });
        amountOut = swapRouter.exactInputSingle(params);

        emit SwapForGivenInput(token1, token2, amountIn, amountOut);
    }

    function swapForGivenOutput(
        address token1,
        address token2,
        uint amountOut,
        uint amountInMaximum,
        uint deadline
    ) external returns (uint amountIn) {
        require(deadline > block.timestamp, "ETFSwapper: Deadline passed");

        TransferHelper.safeTransferFrom(
            token1,
            msg.sender,
            address(this),
            amountInMaximum
        );
        TransferHelper.safeApprove(
            token1,
            address(swapRouter),
            amountInMaximum
        );

        ISwapRouter.ExactOutputSingleParams memory params = ISwapRouter
            .ExactOutputSingleParams({
                tokenIn: token1,
                tokenOut: token2,
                fee: 3000, // Example fee tier, you can make it configurable
                recipient: msg.sender,
                deadline: deadline,
                amountOut: amountOut,
                amountInMaximum: amountInMaximum,
                sqrtPriceLimitX96: 0
            });

        amountIn = swapRouter.exactOutputSingle(params);

        if (amountIn < amountInMaximum) {
            TransferHelper.safeApprove(token1, address(swapRouter), 0);
            TransferHelper.safeTransfer(
                token1,
                msg.sender,
                amountInMaximum - amountIn
            );
        }

        emit SwapForGivenOutput(token1, token2, amountIn, amountOut);
    }

    function multiSwapForGivenInput(
        address token0,
        address token1,
        uint amountIn,
        uint24 fee,
        uint deadline
    ) external returns (uint amountOut) {
        require(deadline > block.timestamp, "ETFSwapper: Deadline passed");

        TransferHelper.safeTransferFrom(
            token0,
            msg.sender,
            address(this),
            amountIn
        );
        TransferHelper.safeApprove(token0, address(swapRouter), amountIn);

        ISwapRouter.ExactInputParams memory params = ISwapRouter
            .ExactInputParams({
                path: abi.encodePacked(token0, fee, token1),
                recipient: msg.sender,
                deadline: deadline,
                amountIn: amountIn,
                amountOutMinimum: 0
            });
        amountOut = swapRouter.exactInput(params);

        emit MultiSwapForGivenInput(token0, token1, amountIn, amountOut);
    }

    function multiSwapForGivenOutput(
        address token0,
        address token1,
        uint amountOut,
        uint amountInMaximum,
        uint deadline
    ) external returns (uint amountIn) {
        require(deadline > block.timestamp, "ETFSwapper: Deadline passed");

        TransferHelper.safeTransferFrom(
            token0,
            msg.sender,
            address(this),
            amountInMaximum
        );
        TransferHelper.safeApprove(
            token0,
            address(swapRouter),
            amountInMaximum
        );

        ISwapRouter.ExactOutputParams memory params = ISwapRouter
            .ExactOutputParams({
                path: abi.encodePacked(token0, uint24(3000), token1),
                recipient: msg.sender,
                deadline: deadline,
                amountOut: amountOut,
                amountInMaximum: amountInMaximum
            });

        amountIn = swapRouter.exactOutput(params);

        if (amountIn < amountInMaximum) {
            TransferHelper.safeApprove(token0, address(swapRouter), 0);
            TransferHelper.safeTransfer(
                token0,
                msg.sender,
                amountInMaximum - amountIn
            );
        }

        emit MultiSwapForGivenOutput(token0, token1, amountIn, amountOut);
    }
}

